<script lang="ts" setup>
const map = ref<SVGElement>()

onMounted(() => {
  if (!map.value) {
    console.warn('Unable to instantiate map element in contour map')
    return
  }

  const paths = [...map.value.querySelectorAll('path')]

  console.log({ paths })

  const lengths: number[] = []
  for (const path of paths) {
    const length = path.getTotalLength()
    path.style.strokeDasharray = `${length} ${length}`
    path.style.strokeDashoffset = `${length}`
    lengths.push(length)
  }

  let handle = 0
  let currentFrame = 0
  const totalFrames = 1200

  console.log({ paths, lengths })

  const draw = () => {
    let progress = currentFrame / totalFrames
    if (progress > 1) {
      return window.cancelAnimationFrame(handle)
    }
    console.log('running')

    currentFrame++
    for (const [index, path] of paths.entries()) {
      path.style.strokeDashoffset = `${Math.floor(lengths[index] * (1 - progress))}`
    }
    handle = window.requestAnimationFrame(draw)
  }
  draw()
})
</script>
